Open the hello_world.kind2 file on the Text Editors , it is going to be empty, but no worries, remember our little story in About Kind about exploring a Universe? This is just your first exploration. Starting now, there are going to be some advanced concepts. But don't be scared, everything will make sense in the future, ethoses concepts that are pertinent will be explained in it's given time. It is recommended that you manually type the codes, instead of copy pasting them in your file. Let's write your first code into the hello_world.kind2 file: //hello_world.kind2
Main { "Hello, Kind!"
} And that's it! That's how a Kind "Hello World!" is written. A print function in four lines.

