A Type is basically a box to keep the Constructors. The Bool Type, for example, is a box that stores the true and false constructors. But remember, when inside that box, they don't have any value, just a name, in order to have values, they need to be inside functions. Reminder: The box is just a container, and so, it is used as an example. A type could be represented by anything with the capability to store things. Constructors represents the concrete values stored by a Type, and are called by using it's type name + constructor name: // Boolean type
type Bool { true false
} // representation of the value Bool.true //or Bool.false The Bool.true and Bool.false are the correct way to call those constructors outside their Type. In this case, the Bool Type.
